const char* getNamedResource (const char* resourceNameUTF8, int& numBytes) throw()
{
    unsigned int hash = 0;
    if (resourceNameUTF8 != 0)
        while (*resourceNameUTF8 != 0)
            hash = 31 * hash + (unsigned int) *resourceNameUTF8++;

    switch (hash)
    {
        case 0xebf742f0:  numBytes = 879; return CircleDark_png;
        case 0x7ed24cf6:  numBytes = 1981; return CircleDark2x_png;
        case 0x2a3b2070:  numBytes = 819; return CircleLight_png;
        case 0x3b94ca76:  numBytes = 1954; return CircleLight2x_png;
        case 0xc3d16e98:  numBytes = 364420; return eqpoints_json;
        case 0x63a1442d:  numBytes = 26428; return COPYING;
        default: break;
    }

    numBytes = 0;
    return 0;
}

